#include "../header.h"

class Solution {
   public:
    int dfs(int n, const vector<vector<int>>& g, int index, vector<int>& path, vector<bool>& visited) {
        path.emplace_back(index);
        if (path.front() == path.back() && path.size() > 1) {
            return path.size() - 1;
        }
        int result = -1;
        if (!visited[index]) {
            visited[index] = true;
            for (auto v : g[index]) {
                result = max(result, dfs(n, g, v, path, visited));
            }
        }
        path.pop_back();
        return result;
    }

    int longestCycle(const vector<int>& edges) {
        const int n = edges.size();

        int result = -1;
        vector<bool> visited(n);
        for (int i = 0; i < n; ++i) {
            if (!visited[i]) {
                int j = i;
                int k = i;
                int joffset = 0;
                int koffset = 0;
                do {
                    if (j != -1) {
                        if (visited[j]) {
                            break;
                        }
                        visited[j] = true;
                        j = edges[j];
                        ++joffset;
                    }
                    if (k != -1) {
                        k = edges[k];
                        ++koffset;
                        if (k != -1) {
                            k = edges[k];
                            ++koffset;
                        }
                    }
                } while (j != k);
                if (j != -1 && k != -1) {
                    if (koffset - joffset > result) {
                        int len = 0;
                        int v0 = j;
                        int v = j;
                        do {
                            v = edges[v];
                            ++len;
                        } while (v != v0);
                        result = max(result, len);
                    }
                }
            }
        }
        return result;

        vector<vector<int>> g(n);
        for (int i = 0; i < n; ++i) {
            if (edges[i] >= 0) {
                g[i].emplace_back(edges[i]);
            }
        }

        int res = -1;

        for (int i = 0; i < n; ++i) {
            vector<int> path;
            vector<bool> visited(n);
            res = max(res, dfs(n, g, i, path, visited));
        }

        return res;
    }
};

